import { makeStyles } from 'tss-react/mui';
import { white, toma } from '@mui/material/colors'

const useStyles = makeStyles()({
    submitButton: {
        padding: '5px',
        borderRadius: '5px',
        color: white,
        backgroundColor: 'tomato',
        cursor: 'pointer',
      },
      star: {
        color: 'gold',
      },
      card: {
        width: '250px',
        height: '250px',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'space-around',
      },
  });
  export default useStyles;
